import React, { Component } from "react";
import Accordion from './Accordion';
 
class About extends Component {
  render() {
    return (
      <div id="aboutSection">
      <div id="education">
        
        <div id="qualifications">
          <h2>Education</h2>
          <Accordion/>
        </div>

   
      </div>

      <div id="skills">

      <div id="skillsTitle">
          <h2>Skills</h2>
        </div>

        <div className="skillsList">
          Frontend
        </div>
      </div>
    </div>
    );
  }
}
 
export default About;
